import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
  CartesianGrid
} from "recharts";

// Sample chart data
const routeData = [
  { route: "SEA-JFK", waste: 3600 },
  { route: "ATL-PHX", waste: 3900 },
  { route: "LAX-SFO", waste: 3200 },
  { route: "MIA-ORD", waste: 4100 },
  { route: "NYC-LAX", waste: 3000 },
  { route: "LAS-DFW", waste: 4500 },
  { route: "BOS-DEN", waste: 4800 }
];

// Same breakdown for each route (mock)
const routeBreakdowns = {
  "SEA-JFK": { "Fruit Bowl": 800, "Chicken Curry": 900, "Salad Bowl": 700 },
  "ATL-PHX": { "Rice Bowl": 1000, "Paneer Wrap": 800 },
  "LAX-SFO": { "Tofu Stir Fry": 900, "Chicken Sandwich": 900 },
  "MIA-ORD": { "Burger": 1200, "Egg Roll": 1000 },
  "NYC-LAX": { "Lentil Curry": 950, "Chickpea Stew": 800 },
  "LAS-DFW": { "Beef Burrito": 950, "Fruit Bowl": 900 },
  "BOS-DEN": { "Pasta Salad": 1000, "Salad Bowl": 800 }
};

const RouteLineChart = () => {
  const [selectedRoute, setSelectedRoute] = useState(null);
  const [filter, setFilter] = useState("Monthly");

  const handleClick = (data) => {
    setSelectedRoute(data.route);
  };

  const renderBreakdown = (route) => {
    const breakdown = routeBreakdowns[route];
    if (!breakdown) return null;

    const maxItem = Object.entries(breakdown).reduce((a, b) => (b[1] > a[1] ? b : a));
    return (
      <div style={{ background: "#fff", padding: "1rem", marginTop: "1rem", borderRadius: "8px" }}>
        <h3>🗂️ Waste Breakdown for {route}</h3>
        <ul>
          {Object.entries(breakdown).map(([item, grams]) => (
            <li key={item}>
              {item === maxItem[0] ? <strong>{item}: {grams}g</strong> : `${item}: ${grams}g`}
            </li>
          ))}
        </ul>
        <p style={{ fontStyle: "italic", marginTop: "0.5rem" }}>
          ✈️ <strong>Insight:</strong> {route} has significant waste from <strong>{maxItem[0]}</strong>. Consider reducing quantity or offering alternatives.
        </p>
      </div>
    );
  };

  return (
    <div style={{ marginTop: "1rem" }}>
      {/* 🔽 Filter Dropdown */}
      <div style={{ display: "flex", justifyContent: "flex-end", marginBottom: "1rem" }}>
        <label style={{ marginRight: "10px", fontWeight: "bold" }}>Filter:</label>
        <select
          value={filter}
          onChange={(e) => setFilter(e.target.value)}
          style={{ padding: "6px 12px", borderRadius: "6px", border: "1px solid #ccc" }}
        >
          <option>Monthly</option>
          <option>Quarterly</option>
          <option>By Route</option>
        </select>
      </div>

      <ResponsiveContainer width="100%" height={300}>
        <LineChart data={routeData} onClick={({ activePayload }) => handleClick(activePayload[0].payload)}>
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="route" />
          <YAxis label={{ value: "Waste (g)", angle: -90, position: "insideLeft" }} />
          <Tooltip formatter={(value) => [`${value}g`, "Waste"]} />
          <Line type="monotone" dataKey="waste" stroke="#8884d8" strokeWidth={2} dot={{ r: 5 }} />
        </LineChart>
      </ResponsiveContainer>

      {selectedRoute && renderBreakdown(selectedRoute)}
    </div>
  );
};

export default RouteLineChart;
